import React from 'react';
import { HiMenuAlt3, HiOutlineX } from "react-icons/hi";
import { Link } from 'react-router-dom';
import logo from "../assets/logo.png";
import Container from '../components/container';
import boxImg from '../assets/boxImage.png';



function Dashboard() {
    const document = [
      {
        image: boxImg,
        title: "THE YAM PROJECT",
        explain:
          "Price per unit: #5000 \nPrice per unit: #5000 \nPrice per unit: #5000 \nPrice per unit: #5000 \nPrice per unit: #5000",
        links: "View full details",
      },
      {
        image: boxImg,
        title: "THE YAM PROJECT",
        explain:
          "Price per unit: #5000 \nPrice per unit: #5000 \nPrice per unit: #5000 \nPrice per unit: #5000 \nPrice per unit: #5000",
        links: "View full details",
      },
    ];
  return (
    <div className=''>
      <nav className="bg-white z-40">
        <div className="w-5/6 mx-auto flex justify-between">
          <div className="md:ml-[40px] md:w-[200px] w-[120px]  md:py-5 p-4">
            <img src={logo} alt="logoimg" />
          </div>
          <button>
            <HiMenuAlt3 size={35} />
          </button>
        </div>
      </nav>
      <div className="flex border-2 h-[600px] overflow-auto">
    <div className='h-full'>
        
    </div>
      </div>
    </div>
  );
}

export default Dashboard
